        for i in range(size):
            for j in range(size):
                if (i == j) == (x == y):
                    return True
        return False

    def count_black_cells(x, y, size):
        count = 0
        for i in range(x, x + size):
            for j in range(y, y + size):
                if grid[i][j] == 'B':
                    count += 1
        return count

    def check_valid(x, y, size):
        if check_square(x, y, size):
            return True
        else:
            return False

    def solve_recursive(x, y, size, current_black_count):
        if x == size and y == size:
            if check_valid(x, y, size):
                return current_black_count
            else:
                return float('inf')

        if x == size:
            return solve_recursive(y + 1, 0, size, current_black_count)

        if y == size:
            return solve_recursive(x + 1, 0, size, current_black_count)

        if check_valid(x, y, size):
            return current_black_count + count_black_cells(x, y, size)

        return float('inf')

    min_black_count = float('inf')
