import math


def dot(a, b):
    return a[0] * b[0] + a[1] * b[1]


def cross(a, b):
    return a[0] * b[1] - a[1] * b[0]


def angle(a, b):
    return math.acos(dot(a, b) / (dot(a, a) * dot(b, b)))


def dist(a, b):
    return math.sqrt(dot(a, b))


def is_opposite(a, b):
    return angle(a, b) == math.pi


def is_clockwise(a, b):
    return angle(a, b) < math.pi


def is_counterclockwise(a, b):
    return angle(a, b) > math.pi


