        if x > 0:
            neighbors.append((x - 1, y))
        if x < n - 1:
            neighbors.append((x + 1, y))
        if y > 0:
            neighbors.append((x, y - 1))
        if y < m - 1:
            neighbors.append((x, y + 1))
        return neighbors

    def find_path(start_x, start_y, path):
        neighbors = get_neighbors(start_x, start_y)
        for neighbor in neighbors:
            if is_valid(neighbor[0], neighbor[1]):
                new_path = path + maze[neighbor[0]][neighbor[1]]
                if len(new_path) == k:
                    return new_path
                elif len(new_path) < k:
                    new_path = new_path + maze[neighbor[0]][neighbor[1]]
        return None

    def find_min_path(start_x, start_y):
        return min(find_path(start_x, start_y, ''))

