        segments.append((l, r))

    edges = []
    for l, r in segments:
        edges.append((l, r))

    def is_tree(edges):
        if not edges:
            return True

        adj = [[] for _ in range(n + 1)]
        for l, r in edges:
            adj[l].append(r)
            adj[r].append(l)

        visited = [False] * (n + 1)
        stack = [1]

        while stack:
            v = stack.pop()
            if visited[v]:
                continue

            visited[v] = True
            for neighbor in adj[v]:
                if not visited[neighbor]:
                    stack.append(neighbor)
                    stack.append(v)

        return not visited.count(False)

    print('YES' if is_tree(edges) else 'NO')


