    n, m = map(int, input().split())
    s = list(input())

    def check_win(seq):
        for i in range(n + 1):
            if seq[i] != '0':
                if seq[i] == '1':
                    if i + seq[i] > n:
                        return False
        return True

    def find_shortest_win(seq):
        queue = [(seq, 0)]
        visited = {tuple(seq)}

        while queue:
            curr_seq, turns = queue.pop(0)

            if curr_seq == seq:
                if check_win(curr_seq):
                    return curr_seq

            for i in range(n + 1):
                if i + curr_seq[i] <= n and (i + curr_seq[i], curr_seq[i]) not in visited:
                    new_seq = list(curr_seq)
                    new_seq[i] += curr_seq[i]
                    new_seq[i + 1:] = curr_seq[i + 1:]
                    queue.append((new_seq, turns + 1))
                    visited.add(tuple(new_seq))

        return -1

    shortest_win = find_shortest_win(s)

    if shortest_win == -1:
        print('-1')
    else:
        print(*shortest_win)


