            elif move[0] == 'v' and c < m - 1 and r < n - 1:
                r += 1
            elif move[0] == '<' and c > 0 and r > 0:
                r -= 1
            elif move[0] == '<' and c < m - 1 and r < n - 1:
                r += 1
            elif move[0] == '>' and c > 0 and r > 0:
                r -= 1
            elif move[0] == '>' and c < m - 1 and r < n - 1:
                r += 1
            elif move[0] == '^' and c > 0 and r > 0:
                r -= 1
            elif move[0] == '^' and c < m - 1 and r < n - 1:
                r += 1
        return r == 0 and c == 0

    def backtrack(r, c, moves):
        if r == n - 1 and c == m - 1:
            return moves

        if r == n - 1:
            return backtrack(r, c + 1, moves + ['^'])

        if c == m - 1:
            return backtrack(r + 1, c, moves + ['<'])

        if is_valid(r, c, moves):
            return backtrack(r, c + 1, moves + ['<'])
        else:
            return backtrack(r + 1, c, moves + ['>'])

    moves = []
    for r, c in blocks:
        moves.extend(backtrack(0, 0, []))

    if not moves:
