    for _ in range(m):
        roads.append(list(map(int, input().split())))

    mod = 1000000007

    def count_shortest_paths(roads, start, end):
        graph = {i: [] for i in range(1, n + 1)}
        for road in roads:
            graph[road[0]].append((road[1], road[2]))

        def bfs(start, end):
            queue = [(start, 0)]
            visited = {start}

            while queue:
                node, dist = queue.pop(0)
                if node == end:
                    yield dist
                for neighbor, length in graph[node]:
                    if neighbor not in visited:
                        visited.add(neighbor)
                        queue.append((neighbor, dist + length))
            yield None

        return sum(bfs(start, end) for _ in range(n - 1))

    def count_paths(roads, start, end):
        graph = {i: [] for i in range(1, n + 1)}
        for road in roads:
            graph[road[0]].append((road[1], road[2]))

        def dfs(start, end, path):
            if start == end:
                return path
            for neighbor, length in graph[start]:
                if neighbor not in path:
                    new_path = path + [neighbor]
                    new_path = dfs(neighbor, end, new_path)
                    if new_path is not None:
                        return new_path
            return None

        return sum(dfs(start, end, []) for _ in range(n - 1))

    for road in roads:
        print(count_paths(roads, road[0], road[1]) % mod)


