                if dx == 0 and dy == 0:
                    continue
                nx, ny = x + dx, y + dy
                if 0 <= nx < n and 0 <= ny < m:
                    if grid[nx][ny] == '#':
                        return False
        return True

    def place(x, y):
        for dx in [-1, 0, 1]:
            for dy in [-1, 0, 1]:
                if dx == 0 and dy == 0:
                    continue
                nx, ny = x + dx, y + dy
                if 0 <= nx < n and 0 <= ny < m:
                    grid[nx][ny] = 'E'

    def remove(x, y):
        for dx in [-1, 0, 1]:
            for dy in [-1, 0, 1]:
                if dx == 0 and dy == 0:
                    continue
                nx, ny = x + dx, y + dy
                if 0 <= nx < n and 0 <= ny < m:
                    grid[nx][ny] = '.'

    for i in range(n):
        for j in range(m):
            if grid[i][j] == '#':
                if check(i, j, 0):
                    place(i, j)
                    break
        if i < n - 1:
            remove(i + 1, 0)

    for j in range(m):
        for i in range(n):
            if grid[i][j] == '#':
                if check(i, j, 1):
                    place(i, j)
                    break
        if j < m - 1:
            remove(i, j + 1)

    print(''.join(grid))


