def solve():
    a, b, k = map(int, input().split())

    min_val = 0
    max_val = 0

    for i in range(a, b + 1):
        if i < min_val:
            min_val = i
        if i > max_val:
            max_val = i

    result = []
    for i in range(min_val, max_val + 1):
        if i < a or i > b:
            continue

        if i - min_val <= k and i + max_val >= k:
            result.append(i)

    print(*result)


solve()
